import React, { useEffect } from "react";
import styles from "../styles/StudentList.module.css";
import { useSelector, useDispatch } from "react-redux";
import { getUserList } from "../features/userSlice";

function StudentList() {
  const dispatch = useDispatch();
  const [student, setStudent] = React.useState("");
  const [veiwStudent, setViewStudent] = React.useState(null);
  const token = useSelector((state) => state.auth.token);
  const users = useSelector((state) => state.user.users);

  useEffect(() => {
    dispatch(getUserList(token));
    // eslint-disable-next-line
  }, []);

  console.log(student);
  console.log(users);
  return (
    <div className={styles.studentList}>
      <input onChange={(e) => setStudent(e.target.value)} />
      <div className={styles.dataContainer}>
        {users
          .filter((user) => {
            if (student === "") {
              return null;
            } else if (
              user.full_name.toLowerCase().includes(student.toLowerCase())
            ) {
              return user;
            } else {
              return null;
            }
          })
          .map((u, index) => (
            <div
              onClick={() => setViewStudent(u.id)}
              className={styles.studentRow}
              key={index}
            >
              <div className={styles.id}>
                <span>{u.id}</span>
              </div>
              <div
                className={styles.name}
              >{`${u.first_name} ${u.last_name}`}</div>
              <div className={styles.email}>{u.email}</div>
              <div className={styles.iem}>{u.last_login}</div>
            </div>
          ))}
      </div>
    </div>
  );
}

export default StudentList;
